import React, { useEffect } from "react";
import "./Nav.css";

function Nav() {
  useEffect(() => {}, []);
  return (
    <div className="nav">
      <img
        className="nav_logo"
        src="http://assets.stickpng.com/images/580b57fcd9996e24bc43c529.png"
        alt="netflix logo"
      />
      <img
        className="nav_avatar"
        src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png"
        alt="netflix logo"
      />
    </div>
  );
}

export default Nav;
